import React from 'react';

const conteudos = [
  {
    conteudo: 'High Order Functions',
    bloco: 8,
    status: 'Aprendido'
  },
  {
    conteudo: 'Composicao de Componentes',
    bloco: 11,
    status: 'Aprendendo',
  },
  {
    conteudo: 'Composicao de Estados',
    bloco: 12,
    status: 'Aprenderei'
  },
  {
    conteudo: 'Redux',
    bloco: 16,
    status: 'Aprenderei'
  },
];

class Content extends React.Component {
  render() {
    return (
        <div key={obj}>
        O conteúdo é: { conteudos.map((items => items.conteudo)) },
        Status: { conteudos.map((items => items.status)) },
        Bloco: { conteudos.map((items => items.bloco)) },
      </div>
    )
  }
}

export default Content
